(5, '老田监理', '老田监理是上海市室内装饰监理专业委员会主任单位。总经理田万康是原电台《老田谈装潢》特约嘉宾主持，监理行业权威人士；老田监理目前是上海最大的装修监理公司之一，管理能力出众，深受申城业主好评。', '上海', '程威', '13636418375', '1//51ba91a62d35b.jpg', 0, 1371181478, '', '', '', '', '', 0, 0, 0),
(3, '玖鹰监理', '', '', '', '', '7//51b987d64f1ba.jpg', 0, 1371113430, '', '', '', '', '', 0, 0, 0),
(4, '验房360', '验房360——沪上验房第一品牌，是由数十位上海顶级验房师形成的专业验房机构！本机构全部带证上岗，一房一验，验后提供权威报告，所有验房照片和质量报告全部在易监理网集中发布；重大房屋问题，安排维权律师提供房产质量的专业维权服务。验房360核心业务是团验，欢迎小区相关人员，欢迎咨询。', '上海、苏州、杭州', '程威', '13636418375', 'f//51ba8f1d058d9.png', 1, 1371180829, '', '', '', '', '', 0, 0, 0),
(6, '预算360', '预算360定位是易监理为全国的装修业主提供在线预算解决方案，目前在上海提供服务试点，本团队技术实力强大，拥有注册造价师、造价员等数十名，能提供专业的预决算服务，帮助业主合理、透明的解决装修造价不合理问题。', '全国，上海', '程威', '13636418375', '0//51ba93ebdb925.png', 1, 1371182059, '', '', '', '', '', 0, 0, 0),
(7, '易监理', '易监理,中国领先的金牌监理师和互联网在线服务模式（www.yijianli.cn)，首家通过互联网透明整个装修过程，加上金牌监理师服务，可极大提升装修品质！选择易监理，装修从此容易！', '全国，上海', '程威', '13636418375', '2//51ba94e465eff.jpg', 1, 1371182308, '&lt;p&gt;&lt;img src=&quot;data/uploads/2//51bad0e1a51aa.jpg&quot; alt=&quot;&quot; border=&quot;0&quot; /&gt;&lt;img src=&quot;data/uploads/7//51bad0edb4e00.jpg&quot; alt=&quot;&quot; border=&quot;0&quot; /&gt;&lt;img src=&quot;data/uploads/e//51bad1029d4f3.png&quot; alt=&quot;&quot; border=&quot;0&quot; /&gt;&lt;img src=&quot;data/uploads/7//51bad115e4d24.png&quot; alt=&quot;&quot; border=&quot;0&quot; /&gt;&lt;img src=&quot;data/uploads/e//51bad12ad2b84.jpg&quot; alt=&quot;&quot; border=&quot;0&quot; /&gt;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '&lt;img src=&quot;data/uploads/3//51bacde0aa8e1.jpg&quot; alt=&quot;&quot; border=&quot;0&quot; /&gt;&lt;br /&gt;', '&lt;img src=&quot;data/uploads/6//51bad35116da4.jpg&quot; alt=&quot;&quot; border=&quot;0&quot; /&gt;&lt;img src=&quot;data/uploads/2//51bad184c622e.jpg&quot; alt=&quot;&quot; border=&quot;0&quot; /&gt;&lt;br /&gt;', '', '&lt;img src=&quot;data/uploads/2//51bad52604810.jpg&quot; align=&quot;left&quot; alt=&quot;&quot; border=&quot;0&quot; /&gt;&lt;br /&gt;', 0, 0, 0);
