(1, '省钱到手，再拿其中一部分付款！就这么爽！', '其实，找易监理是不用额外花费的！\r\n在预算合理化平均可为业主省5%，施工中增项控制可为业主省10%以上，而业主额外得到价值20%的品质提升。而这一切，你可能仅需支付3%的监理费。\r\n易监理采用支付宝支付方式，服务满意再确认支付！充分保障业主的信任！\r\n易监理作为全新的线下精英监理+互联网在线监理服务模式，最大的好处是高度的透明性地“网上监督了装修公司及监理人员的工作”，再加上先服务后支付模式，彻底改变装修业主签约前是老大，签约后装修公司是老大的家装现状！\r\n相信正能量，相信易监理！', 'file/1_8733e3352486b7147803c8d4933ffdeb.jpg', NULL, 0, 574, '1', 1347206400, 1348913143, 5796, 1, 0, 2, 0, 0, 0, 0, 1, 0, 36, 1347292799, NULL, 0, NULL, NULL, NULL, NULL, 1, 30),
(2, '装潢情报首届装修训练营，赶快报名！', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 新交房小区装修业主，正准备装修的业主，或者刚开工的业主，你们还在为装修困惑吗？抑或在找装修同路人？</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 来参加装潢情报杂志社2012首期装修训练营吧，这是特别为你们而展开的。提升20%质量，省10%费用，参加训练营，你可以做到！</p>\r\n<p>&nbsp;</p>\r\n<p><strong>首届训练营学员可获五大价值：</strong></p>\r\n<p>1、每位学员都会分配到一个装修教练，在装修上需要咨询时可及时向教练电话咨询（免费）。</p>\r\n<p>2、预算将得到审核，并获得合同附加条款的建议（此服务目前免费，正常服务收费300元）。</p>\r\n<p>3、用易监理网在线发布装修照片，会获得装修教练及专家组及时的点评或解决方案（免费）。</p>\r\n<p>4、参加易监理的定期组团，可以和材料商集中谈判，获得最合理的建材价格（免费）。</p>\r\n<p>5、选择易监理任何服务均可享受7折优惠。</p>\r\n<p>&nbsp;</p>\r\n<p><strong>10名幸运业主获享&ldquo;免费全程装修跟踪服务&rdquo;的三大好处：</strong></p>\r\n<p>1、帮助业主提升装修质量，以最省钱的方式来控制整个装修过程，服务价值超过3000元。</p>\r\n<p>2、关键的是，帮助幸运业主把装修质量至少提升20%，装修费用节省5%-15%。</p>\r\n<p>3、易监理在线服务：可随时随地在易监理网上看自家装修的不同进度照片和专属教练的专业点评，同时可上传新浪微博与全体营员分享。</p>\r\n<p>（业主以小区为单位，每小区通过抽签最终共确定10名幸运业主）&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>活动流程：</strong></p>\r\n<p>1:30-2:00&nbsp; 登记，发送资料，前50户均赠送装潢情报杂志一份。</p>\r\n<p>2:00-3:20&nbsp; 三个微讲座：家装预算的黑幕及规避；如何最有效率地省钱；如何使用易监理网获得免费专家在线服务。</p>\r\n<p>3:20-3:40&nbsp; 分组，由吴国宝和常壹腊带队，他们自主配备3-5人的技术专家组成团队。</p>\r\n<p>3:40-4:20&nbsp; 自愿竞选，选1名业主作为组长组建本次活动的qq组群，组长可享受第一个免费监理服务名额。</p>\r\n<p>4:20-5:20&nbsp; 为业主提供预算及合同审核服务。</p>\r\n<p>5:20-5:30&nbsp; 活动结束，每个教练最终选择5户业主，为他们免费全程跟踪线下线上的装修。</p>\r\n<p>&nbsp;</p>\r\n<p><strong>活动对象：</strong>新交房小区或即将交房小区业主，以及刚开始装修的业主</p>\r\n<p><strong>活动地址：</strong>装潢情报杂志社*宜山路439号16楼</p>\r\n<p><strong>活动时间：</strong>2012年10月13日或27日14:00-17:30</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 赶快参加吧！报名即有机会获2980元监理专家服务，幸运业主名额有限，仅限10户。</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 到场业主均可获赠价值300元的预算审核及合同建议，若您在现场选择易监理的各项监理服务，一律享受7折优惠！</p>\r\n<p>&nbsp;</p>\r\n<p><strong>活动声明：本系列活动承诺不与任何装修公司合作，</strong>真正为业主考虑并提供专业服务（活动经费由品牌商赞助实施）。</p>', 'file/1_4a77f6f376395ef7ff523c252e6ba403.jpg', NULL, 0, 701, '1', 1350057600, 1354080036, 5804, 1, 0, 11, 2, 0, 2, 0, 1, 0, 2, 1350143999, '装潢情报杂志社*宜山路439号16楼', 0, NULL, NULL, NULL, NULL, 0, 10),
(3, '★★★史上最划算【隐蔽工程专项监理服务】', '<p align="left">史上最划算&ldquo;隐蔽工程专项监理服务&rdquo;</p>\r\n<p align="left">最起码在隐蔽工程阶段&ldquo;体验一次最品质的易监理服务&rdquo;！</p>\r\n<p align="left"><strong>工作要点：</strong></p>\r\n<p align="left">隐蔽工程施工要点交底，隐蔽工程材料验收，隐蔽工程水电路定位开槽、水电工排管、穿线，防水工程及水路改造，隐蔽工程验收</p>\r\n<p align="left"><strong>服务方式及收费：</strong></p>\r\n<p align="left">现推易监理隐蔽工程服务卡，分三次卡（799元）和五次卡（999元），均含一次隐蔽工程验收！</p>\r\n<p align="left"><strong>让行业最优秀的监理师为您服务：</strong></p>\r\n<p align="left">常壹腊&mdash;&mdash;易监理执行总监，原统帅工程部经理，行业最资深的家装水电工程专家。（仅限服务15户）</p>\r\n<p align="left">吴国宝&mdash;&mdash;上海市装修315标准制定者之一，上海最优秀的三大家装监理师之一。（仅限服务15户）</p>\r\n<p align="left">&nbsp;</p>\r\n<p align="left">注：</p>\r\n<p align="left">1、本活动报价仅针对150平以下公寓房的隐蔽工程监理服务报价（免车马费）。</p>\r\n<p align="left">2、别墅项目隐蔽工程三次服务卡优惠价为1499元（含验收，免车马费）。</p>\r\n<p align="left">3、本活动仅限30户，可以预定明年的隐蔽工程专项监理。</p>\r\n<p>4、活动截止于2012年12月31日，本活动不可与易监理其它活动优惠同时享用。</p>', 'file/1_a693e35e7cb2f01cc11c03a12a871443.gif', NULL, 0, 1946, '1', 1355155200, 1355216275, 5852, 1, 0, 1, 0, 4, 0, 0, 1, 1, 2, 1356969599, '各个小区', 0, NULL, NULL, NULL, NULL, 1, 30),
(4, '2013金牌监理最强档，疯狂预约中！', '<p><strong><span style="color: #000000;">2013金牌监理最强档，疯狂预约！四大金牌监理任你选！</span></strong></p>\r\n<p>年前帮你&ldquo;审图纸预算&rdquo;，帮签订合同。全程监理78折优惠，仅限春节后的服务预定。</p>\r\n<p>&nbsp;</p>\r\n<p><strong>年前准备好，年后好装修</strong></p>\r\n<p>年前，易监理金牌监理师为您审图纸、预算及合同。</p>\r\n<p>1、&nbsp; 重点审施工图纸是否规范、全面，节点图是否正确；</p>\r\n<p>2、&nbsp; 重点审预算的单价是否合理，是否有漏项，是否有重复收费项等</p>\r\n<p>3、&nbsp; 重点审合同预算所列材料品牌型号是否详细；</p>\r\n<p>4、&nbsp; 重点提交合同附加条款，使这些条款在出现问题时候，能切实的保障业主的利益。</p>\r\n<p>&nbsp;</p>\r\n<p><strong>易监理四大金牌监理</strong></p>\r\n<p>业主可自主选定易监理金牌监理师，指定监理师本人为您服务，绝不发包！</p>\r\n<p>吴国宝：56岁，上海装修315标准制定之一，上海最好的家装监理三者必有其一。</p>\r\n<p>常壹腊：54岁，注册高级监理师，水电专家，行业最资深的监理师之一。</p>\r\n<p>施井德：52岁，从业22年，资深项目经理出身，对施工工艺极其专业，在优秀监理师中以品质控制能力强著称。</p>\r\n<p>张文海：别墅专职监理师，对装修、结构改建、机电、智能化、空调等均有极强专业监理技能。</p>\r\n<p>&nbsp;</p>\r\n<p><strong>服务满意再支付</strong></p>\r\n<p>支付宝支付</p>\r\n<p>标准服务，一律开具发票（易监理投资方要求提供标准化财务，同时确保了易监理为您提供品质服务。）</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>如何参与本活动：</strong></p>\r\n<p>1、篱笆易监理店铺预约，给予78折优惠服务价。</p>\r\n<p>2、支付宝支付或现金支付定金800元（包含预算合同审理费用）</p>\r\n<p>&nbsp;</p>', 'file/1_6889f64b58c80cd8bd6cc9baa2431623.gif', NULL, 0, 2117, '1', 1358179200, 1364705565, 5854, 1, 0, 2, 3, 4, 0, 0, 1, 1, 2, 1362067199, '上海各个小区', 0, NULL, NULL, NULL, NULL, 0, 10),
(5, '赶走水分 迎接透明', '<p align="center"><strong>赶走水分&nbsp; 迎接透明</strong></p>\r\n<p align="center"><strong>易监理预算中心和家网新春特惠服务</strong></p>\r\n<p align="center">&nbsp;</p>\r\n<p align="center">预算审核最低199元（原价5元/㎡）；</p>\r\n<p align="center">至少为您省2000元的装修费用；</p>\r\n<p align="center">选择易监理预算中心，你会像春风吹过一样的温暖~~</p>\r\n<p align="center">&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>一、在线预算审核</strong></p>\r\n<p><strong>参加条件：</strong>业主需提供电子格式的预算书（手机照片也可以）、最好有详细施工图纸，至少有标准尺寸的平面布局图。</p>\r\n<p><strong>为您提供：</strong></p>\r\n<p class="a">1、&nbsp; 详细预算分析报告（列出主要漏算、多算、单价高，材料不清等各类预算陷阱，并提供预算建议及合理价格幅度）</p>\r\n<p class="a">2、&nbsp; 根据预算，提供针对性的合同增加条款建议，使您在利益受到损失时，通过合同保障自己的利益。</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>在线预算-</strong><strong>特价服务（原价是5</strong><strong>元/</strong><strong>平）：</strong></p>\r\n<p>199元&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;100㎡</p>\r\n<p>229元&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 100㎡-120㎡</p>\r\n<p>299元&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 120㎡-150㎡</p>\r\n<p>399元&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 150㎡-200㎡</p>\r\n<p>499元&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 200㎡-300㎡</p>\r\n<p>599元&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 300㎡-400㎡</p>\r\n<p>699元&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 400㎡-500㎡</p>\r\n<p>799元&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &gt;500㎡</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>二、提供预算规划服务</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>如果您只有一张平面布局图，希望知道自己的预算规划，本预算中心将为您提供专业预算规划建议；</p>\r\n<p>您将得到：</p>\r\n<p>1、预算分配专业咨询（需填写需求表）；</p>\r\n<p>2、根据您的平面布局方案所做的详细半包估算；（因为半包相对固定，提供每个细项的标准市场人工及材料单价）</p>\r\n<p>3、提供主材预算框架；（提供每个细项的标准市场人工及材料单价）</p>\r\n<p>该项服务在试运行期，需要另行计费，欢迎预约。</p>\r\n<p align="right"><strong>&nbsp;</strong></p>\r\n<p><strong>三、赠送10</strong><strong>次在线易监理咨询服务</strong></p>\r\n<p>登录易监理网（www.yijianli.cn），提出您在装修各时期遇到的问题，选择您喜欢的值班监理师，即有值班监理师在12小时内给您作答。在线咨询服务免费次数仅10次。</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>四、活动说明：</strong></p>\r\n<p>1、&nbsp; 预约后，支付宝及各类网上银行提前支付。</p>\r\n<p>2、&nbsp; 提供详细预算报告及解决建议，但不包括上门洽谈服务。若要陪同去装潢公司洽谈，公寓房800元/次（包含在线预算服务费用），别墅及复式1500元/次起（包含在线预算服务费用）。</p>\r\n<p>3、&nbsp; 需将电子版的预算书、图纸及平面布局图传至我司邮箱5678107@qq.com。</p>\r\n<p>4、&nbsp; 在线审核，两日内提交审核报告，但90%的业主会在24小时内即提供预算解决方案。</p>\r\n<p>5、&nbsp; 活动截止至：2013年9月30日。</p>\r\n<p>6、&nbsp; 联系我们：</p>\r\n<p>公司地址：上海市杨浦区国康路46号3号楼1002室</p>\r\n<p>客服电话：400-990-2013</p>\r\n<p>电话：021-5557-3350</p>\r\n<p>QQ：5678107</p>\r\n<p>公司邮箱：5678107@qq.com</p>\r\n<p>&nbsp;</p>\r\n<p>本活动的解释权归上海易至居工程监理有限公司所有</p>\r\n<p align="center"><strong>&nbsp;</strong></p>\r\n<p align="center"><strong>易监理预算中心</strong></p>\r\n<p><strong>易监理预算中心介绍：</strong></p>\r\n<p>赶走水分，迎接透明&mdash;&mdash;这是易监理预算中心的<strong>核心服务理念</strong>。</p>\r\n<p>易监理深知家装行业的问题，业主是很难专业有效的保护自己的权益，<strong>特别在预算方面</strong>，市场上充斥着漏项、高价、分拆、材料标注不清楚等不透明现状。</p>\r\n<p>易监理预算中心希望作为业主的贴心人，专业地帮助广大装修业主得到公正合理的装修预算，并且提供专业的合同条款建议。</p>\r\n<p>赶走水分，迎接透明！我们一直为预算合理而努力！</p>\r\n<p>&nbsp;</p>\r\n<p><strong>预算师团队</strong></p>\r\n<p>注册造价师，一级建造师：饶章龙</p>\r\n<p>资深预算师：顾更魁</p>\r\n<p>资深预算师：吴国宝</p>\r\n<p>资深预算师：李震</p>\r\n<p>注册造价员：高扬</p>\r\n<p>资深造价师：王文新</p>\r\n<p>&nbsp;</p>\r\n<p>易监理预算中心法律顾问：殷立平</p>\r\n<p>专业帮助业主进行家装领域的维权及相关律师服务。</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>一直为预算合理而努力&mdash;&mdash;易监理预算中心</strong></p>', 'file/1_f75dcf340055eaa18e29b6c89f61fe42.gif', NULL, 0, 5136, '1', 1363622400, 1363743721, 5883, 1, 0, 1, 2, 3, 0, 0, 1, 1, 2, 1380556799, NULL, 0, NULL, NULL, NULL, NULL, 0, 10),
(6, '装修邻居对对碰-第五期', '<p align="left">春季装修好时节，同一小区，和邻居结伴装修，全程监理即可享受金牌监理服务72折特惠！</p>\r\n<p>&nbsp;</p>\r\n<p><strong>全程监理仅72</strong><strong>折！！！</strong></p>\r\n<p>同一小区，你和任意邻居结伴装修，即两户业主均可享受72折全程监理服务优惠。</p>\r\n<p>&nbsp;</p>\r\n<p><strong>赠送四大增值监理服务</strong></p>\r\n<p>地暖、空调、智能化、水处理赠送四大增值监理服务，帮您省去1000元以上费用。</p>\r\n<p>&nbsp;</p>\r\n<p><strong>和邻居一起装修的好处：省钱，省时，更好质量！</strong></p>\r\n<p>&nbsp;</p>\r\n<p>1、&nbsp; 绝对省钱，至少省5%以上&mdash;&mdash;材料，装修，设计，监理四大省钱面。</p>\r\n<p>2、&nbsp; 省时间&mdash;&mdash;一户邻居代表即可参与装修巡查，及时了解情况，绝对让你省时50%以上。</p>\r\n<p>3、&nbsp; 更好质量&mdash;&mdash;监理师协助安排统一采购，材料质量控制更好；</p>\r\n<p>安排统一质量管理，更高效进行质量监控；</p>\r\n<p>可充分保证监理服务时间，使得装修公司更专心做好质量。</p>\r\n<p>4、&nbsp; 团队监督的力量&mdash;&mdash;团队的力量，除了认识邻居成为朋友外，在装修中信息互通，绝对让你受益无穷！</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>监理服务提供&ldquo;三层质量保证&rdquo;</strong></p>\r\n<p>1、&nbsp; 金牌监理&mdash;&mdash;上海滩最优秀的监理师，创个人服务品牌，业主的评价和服务的质量直接和监理师收入挂钩，监理师服务更用心！</p>\r\n<p>2、&nbsp; 技术总监巡查制&mdash;&mdash;所有项目都将进行巡查，采取不定时工地现场巡查制，由监理部技术总监带队，对工地现场的监理服务质量和疑难施工质量进行现场评估和解决。</p>\r\n<p>3、&nbsp; 照片式监理在线监理服务系统&mdash;&mdash;易监理网，中国领先的监理服务网站，给您定期上传装修进程细节照片及监理服务报告，对全社会透明服务，监理服务质量更认真！</p>\r\n<p>&nbsp;</p>\r\n<p><strong>活动方式：</strong></p>\r\n<p>1、&nbsp; 本活动中，单独报名业主，本春季活动全程监理也均给予78折优惠。</p>\r\n<p>2、&nbsp; 本活动仅限150平以下公寓房。</p>\r\n<p>3、&nbsp; 监理服务5户以上提供团购价，欢迎团购，请联系易监理客服：021-65975962，400-990-2013。</p>\r\n<p>4、&nbsp; 本活动不可和易监理其它优惠同时享用。</p>\r\n<p>&nbsp;</p>\r\n<p><strong>活动时间：2013年3月5日-2013年5月31日</strong></p>', 'file/1_a5d81ddfcae3ee9847c49220b8aed8cd.gif', NULL, 0, 5140, '1', 1363622400, 1366806682, 5884, 1, 0, 2, 0, 1, 0, 0, 1, 1, 2, 1370015999, NULL, 0, NULL, NULL, NULL, NULL, 0, 10),
