(11, 341, 138, 0, 6, 1346824654, '按图施工，材料用的是环保材料。', 0),
(2, 332, 301, 0, 14, 1346822872, '铺实木地板，排管要求：纵向地面开槽，横向不开槽  施工方案正确。但是靠墙的一根纵向管也应该开槽埋于地内，保证实木地板铺设最后一块地板不会悬空。', 0),
(9, 339, 134, 0, 14, 1346823684, '顶上过线盒，符合国家要求。', 1),
(5, 335, 132, 0, 14, 1346823090, '从楼上穿线过来，过线盒是对的，但是线管没有线卡固定，不符合规范', 0),
(6, 336, 131, 0, 14, 1346823234, '黄蜡管超过一米，不符合国家规范。', 0),
(10, 340, 302, 0, 14, 1346823729, '墙面电线管未固定在墙线槽以内，会影响后续工序水泥浆的粉刷！', 1),
(12, 342, 137, 0, 14, 1346825028, '按照图纸施工，固定石膏板的干壁钉间距太大。', 1),
(13, 343, 320, 0, 14, 1346825135, '正常施工。', 1),
(14, 344, 319, 0, 14, 1346825186, '工人正在批一遍腻子。', 1),
(15, 352, 324, 0, 14, 1346828459, '用橡皮榔头敲打瓷砖，操作比较规范。', 1),
(16, 353, 322, 0, 14, 1346828605, '地砖铺设，用2米直尺和水平尺边做边检验是否平整，操作比较规范。', 1),
(17, 354, 328, 0, 14, 1346828674, '用灯在自检顶面是否平整，工序正确。', 1),
(19, 356, 305, 0, 14, 1346829090, '走的是明管，铺设复合地板，需要浇制水泥地平，所有线管不要镶嵌在水泥地面中，操作正确。', 1),
(46, 397, 339, 0, 14, 1346833582, '量尺寸，切割瓷砖，工艺规范。', 1),
