(914, 3067, 1750, 0, 96, 1358058505, '家庭装修强电用线，熊猫电线是不错的选择，但是达到国家标准多可以使用，性价比相对高一些，如起凡线等，装修时最应确保的，所穿管线应该是活线，特殊情况例外，也就是说便于检修。', 1),
