(1343, 4915, 3090, 0, 91, 1363251179, '个人建议不打，原因有两点：1，墙面固定住以后，考虑到要做地暖，要做现浇也能固定住下部，2，如果现在打了膨胀螺丝，主要怕后面出现渗水现象。综合考虑建议不打膨胀螺丝在地面上。', 1),
(1344, 4917, 3152, 0, 96, 1363305769, '现状设计方案与开发商的原设计安排产生冲突，厨房下水走向出现问题，阳台虽有地漏是给雨水安排，厨房水斗用水存在污水且管径不同，因此建议厨房下水用雨水管时，安装污水粉碎器，以防止堵塞。', 1),
