INSERT INTO `yjl_j_qz` (`qzid`, `uid`, `jluid`, `xqid`, `cid`, `title`, `content`, `datetime`, `tid`, `jf`, `c_hd`, `c_zan`, `isnew`, `iswc`) VALUES
(1, 2, 16, 3818, 1, NULL, '你好，我房子是公寓房，请一个第三方监理的费用是多少 ?', 1346898752, 451, 0, 1, 0, 0, 0),
(2, 2, 16, 3818, 1, NULL, '请问施工中监理是干什么的？', 1346898912, 453, 0, 1, 0, 0, 0),
(3, 2, 16, 3818, 1, NULL, '如果我不在现场，怎么知道你们有没有帮我做好验收？', 1346898975, 454, 0, 1, 0, 0, 0),
(4, 3, 16, 3825, 1, NULL, '到底有没有必要请监理啊？', 1346899083, 455, 0, 1, 0, 0, 0),
(5, 5, 16, 3787, 2, NULL, '隐蔽工程刚验收，装修公司验收水管时就肉眼看了下，我们觉得应该有什么仪器来检测的吧，装修公司说他们都这么验收的，想问下是不是啊？', 1346899154, 456, 0, 1, 2, 0, 0),
(54, 5, 14, 3787, 1, NULL, '向易监理提问：想问下监理老师，我家装的插座有高有低的，工人说只要同个房间一样就可以了，请问是这样吗？', 1347428432, 682, 0, 1, 0, 0, 0),
(55, 27, 15, 5782, 1, NULL, '请问我已经和装修公司签了施工合同了，但是发觉有些地方在真正施工时还是需要改动的，我提出要在预算里写清楚，但是设计师说以后每各阶段都会出实际的工程项目单，但是这样到时添加的费用就不确定了，请问这个要如何处理呢？', 1347499015, 687, 0, 1, 0, 0, 0),
(7, 7, 14, 5769, 2, NULL, '一天在工地发现木工在帮泥工贴地砖，泥工人不见了，问他什么情况说泥工不做了，怕耽误工期所以让他来顶下，和装修公司沟通说是为了保证工期，说这个木工会贴的，想问下监理可以吗？有什么基本标准？', 1346899308, 458, 0, 1, 1, 0, 0),
(8, 5, 14, 3787, 1, NULL, '请问如果请了全程监理 是不是所有装修的问题包括软装和硬装，都可以请监理出面解决或者向监理请求咨询帮助？', 1346899360, 459, 0, 1, 0, 0, 0),
(9, 6, 16, 3673, 2, NULL, '我怀疑装修公司给我们的板材是假的，不过担心装修公司记仇后面的活乱做，所以没有讲，请问你们可以鉴别真假吗？', 1346899407, 460, 0, 1, 0, 0, 0),
(10, 8, 16, 3779, 1, NULL, '请问预算到底怎么审核，怎么签合同?', 1346899436, 461, 0, 1, 0, 0, 0),
(11, 10, 14, 3719, 2, NULL, '监理老师我想咨询下，我现在水电已经完工了，但验收的时候我不在，项目经理和施工队长说都验过了，要我签字。我觉得不应该签吧，但不签他们就停工了，想问下监理该怎么办？', 1346899475, 462, 0, 1, 0, 0, 0),
(12, 11, 14, 3609, 1, NULL, '本来和装修公司谈下来管理费可以优惠还有其他不少优惠，但说了要请监理，他们说那就没优惠了，全部按原价，这和请监理有冲突吗？', 1346899505, 463, 0, 1, 0, 0, 0),
(13, 13, 14, 3804, 1, NULL, '可以请监理验收装修公司进的材料吗？', 1346899541, 464, 0, 1, 0, 0, 0),
(14, 2, 14, 3818, 1, NULL, '你好,老师.请问我已签了合同,但还没进场施工,发现预算合同里的一些单价偏高,怎么解决?(装修公司要求签了合同,才能给预算)', 1346899591, 465, 0, 1, 0, 0, 0),
(15, 5, 16, 3787, 1, NULL, '我家装修快结束了，但看了你们的介绍发现前面的工程都没有验收，和他们交涉，回答说结束了会一起验收的，请问可以吗？', 1346899636, 466, 0, 1, 0, 0, 0),
(16, 7, 14, 5769, 2, NULL, '请问，如果我找监理验收工程，发现有不合格的，要求装修公司返工。装修公司会不配合吗？或者说要加钱之类的？', 1346900064, 467, 0, 1, 1, 0, 0),
(17, 11, 14, 3609, 1, NULL, '请问，全程监理包含陪同买建材吗？', 1346900192, 468, 0, 1, 0, 0, 0),
(18, 11, 14, 3609, 1, NULL, '再问下，如果请你们监理怎么操作？', 1346900202, 469, 0, 1, 0, 0, 0),
(19, 13, 14, 3804, 1, NULL, '如果是全程监理，是否包括毛坯房交房时的验收？还要另外收费吗？', 1346900233, 470, 0, 1, 0, 0, 0),
(20, 5, 14, 3787, 2, NULL, '我家客厅准备使用天然大理石，但听说有辐射，会影响健康请问是否如此，要怎么选择?', 1346900268, 471, 0, 1, 1, 0, 0),
(21, 2, 14, 3818, 1, NULL, '我找的装修公司说他们送监理也是独立第三方的，请问和你们有区别吗?', 1346900305, 472, 0, 1, 0, 0, 0),
(22, 10, 14, 3719, 2, NULL, '地板是我自己买的由装修公司来铺的，前几天说可以铺了让我把地板送过去，因为忙之后也没去工地看过，后来才知道当时是堆放在阳台上的，现在问题是前几天下雨，把大部分地板淋湿了，装修公司说让他自然干就可以了，但我觉得1地板湿了肯定影响质量的，2我有付管理费装修公司应该保管好材料，3后来问送地板的人说是装修公司说放阳台的。这种情况我该如何处理?', 1346900543, 474, 0, 1, 1, 0, 0),
(23, 13, 14, 3804, 1, NULL, '装修监理是否会签定一份信用保证书?并且这份信用保证书能否和个人信用挂钩、不会因为监理的离职而失效? 如果我找你们推荐的监理，而那个监理和装修公司勾结串通，我能否找你们监理公司索赔？', 1346901374, 478, 0, 2, 0, 0, 0),
(24, 3, 16, 3825, 1, NULL, '请问你们验收时出现质量问题，装修公司不理睬或不配合怎么办？', 1346901413, 479, 0, 1, 0, 0, 0),
(25, 5, 16, 3787, 1, NULL, '我请的装修公司也送第三方监理，但我知道其实他们是有合作关系的，请问你们和装修公司有合作关系吗 ？', 1346901444, 480, 0, 1, 0, 0, 0),
(26, 13, 14, 3804, 1, NULL, '想请监理但装修公司一直说监理没用的，很多监理不太懂装修的，还会骗业主，所以我犹豫要不要请。', 1346901481, 481, 0, 1, 0, 0, 0),
(27, 6, 16, 3673, 1, NULL, '请问监理老师，贵方提供的监理服务包括哪些范围？收费是按什么标准执行的？', 1346901508, 482, 0, 1, 0, 0, 0),
(28, 5, 16, 3787, 1, NULL, '请问监理我已经开工了，还可以做全程监理吗？', 1346901539, 484, 0, 1, 0, 0, 0),
(29, 7, 16, 5769, 1, NULL, '监理老师你好！装修预算报告是设计师出还是装潢公司出？现在很多装潢公司都有设计师，如果用他们的设计师设计后不满意，打算换一家装潢公司，会不会要求出费用（设计图纸都不要）？', 1346902458, 489, 0, 1, 0, 0, 0),
(30, 11, 16, 3609, 1, NULL, '监理费用是一次性付清的吗？', 1346902485, 490, 0, 1, 0, 0, 0),
(31, 8, 16, 3779, 1, NULL, '别墅工期比较长，监理是不是一天隔一天就来？', 1346902515, 491, 0, 1, 0, 0, 0),
(32, 6, 16, 3673, 1, NULL, '我正在犹豫要不要请监理，纠结啊。。如果请的话什么时候找你们啊？', 1346902542, 493, 0, 1, 0, 0, 0),
(33, 13, 16, 3804, 1, NULL, '装潢公司已经帮我出了预算，但是不给我拿回来，有什么办法啊？', 1346902568, 494, 0, 1, 0, 0, 0),
(34, 9, 14, 3601, 1, NULL, '你们的监理和外面的有什么不一样吗？', 1346902628, 496, 0, 1, 0, 0, 0),
(35, 7, 14, 5769, 1, NULL, '我接触了几家装潢公司，其中有一家说认识你们监理的，请了也没用，还不如把这钱省下来。', 1346902659, 497, 0, 1, 0, 0, 0),
(36, 3, 14, 3825, 1, NULL, '我怎么相信你们的监理是不是没什么问题呢？', 1346902687, 499, 0, 1, 0, 0, 0),
(37, 10, 14, 3719, 1, NULL, '监理合同怎么签？不是和监理个人签吧～～还有收费是一次性付款，还是分期付费？如是分期怎么分法？能提供你们监理合同的样本看看吗？ 我现在还没有定下装修公司，如果请监理上装修公司审预算后当天又没有签订合同，下次签合同的时候监理还陪同吗？需要另外收费吗？实际装修前监理陪同审预算、图纸和合同的次数是否有限制？ 我问题比较多，麻烦了～谢谢！', 1346902723, 500, 0, 1, 0, 0, 0),
(38, 11, 14, 3609, 1, NULL, '我需要全程监理，目前装修公司还未最终确定，按一般流程，应该先请监理再签装修合同。那请问监理合同上关于监理服务期会怎么填写？装修公司不确定，我还不知道什么时候会开始和结束啊。比如我下周一来您公司签合同，开始日期就写下周一吗？那结束日期呢？', 1346902756, 501, 0, 1, 0, 0, 0),
(39, 8, 14, 3779, 1, NULL, '目前接触了几家装修公司，出了平面设计图和预算给我。我想请问一般装修的流程是什么，装修公司在签订合同前可以出多少图纸给我们？还是在此时就需要我们确定好公司，签合同后才能继续设计？光凭这个没法确认设计师最后的设计能符合我的要求啊 。那此时就需要监理介入了吗？', 1346902793, 502, 0, 1, 0, 0, 0),
(40, 2, 14, 3818, 2, NULL, '我买的新房，一定要铲掉原来的墙面涂料吗？', 1346902824, 503, 0, 1, 0, 0, 0),
(41, 3, 16, 3825, 1, NULL, '怎样看预算报价呢，有什么正规预算模版可以套用吗? 如果请监理审核一次预算需要多少费用？', 1346902854, 504, 0, 1, 0, 0, 0),
(42, 6, 16, 3673, 2, NULL, '我怎么看设计师给的图纸是不是齐全呢？', 1346902884, 505, 0, 1, 1, 0, 0),
(43, 5, 16, 3787, 1, NULL, '我打算做清包，可以请监理吗？监理陪同买材料吗？', 1346902909, 507, 0, 1, 0, 0, 0),
(44, 2, 14, 3818, 1, NULL, '我找了两家装潢公司，怎么相同的项目，人工费差那么多？', 1346902950, 508, 0, 1, 0, 0, 0),
(45, 3, 16, 3825, 1, NULL, '我找了一家上海老牌的装潢公司，付了8000元的设计费，前天对方又让我们付了10000元的定金，据说不付就不出预算，有没有这种做法的？', 1346902975, 510, 0, 1, 0, 0, 0),
(46, 10, 16, 3719, 1, NULL, '我要明年才交房，是不是在交房那天就要带上监理？', 1346902999, 511, 0, 1, 0, 0, 0),
(47, 13, 16, 3804, 2, NULL, '我厨房间开错了一根槽，现在泥水匠说拿水泥把它封起来就可以了，是不是？', 1346903025, 513, 0, 1, 0, 0, 0),
(48, 11, 16, 3609, 1, NULL, '我已与装修公司签了合同，当时预算没来得及自己研究，现在对照网上价格仔细看看问题不少，现在就请监理陪我一起去再核一次预算，怎么收费？', 1346903071, 514, 0, 1, 0, 0, 0),
(49, 17, 14, 3846, 1, NULL, '我所在小区香逸湾四期，10月份要交房了，能提供验房服务吗，要收费吗？', 1346911142, 550, 0, 1, 0, 0, 0),
(53, 2, 14, 3818, 2, NULL, '想问下监理，这个是我拍下施工的照片，问下这个有没问题？', 1347009726, 582, 0, 1, 0, 0, 0),
(56, 6, 15, 3673, 1, NULL, '听说你们可以免费点评照片？我家正在装修我也不太懂，拍了几张希望你们能帮我看看，谢谢！', 1347587641, 691, 0, 1, 0, 0, 0),
(58, 42, 14, 5589, 1, NULL, '水管是电工排的，说是水电都会做，接头非常多，想请专业监理看一下，是否有存在明显问题。第1张是水槽下的水管，说是水表要装的比增压泵低，增压泵还未装上；第2张氏卫生间水管通往厨房，第3张是厨房顶部走的水管，这么一小段用了4个接头，只是部分照片，想请老师真实的点评一下，谢谢！', 1349654858, 702, 0, 1, 0, 0, 0),
(59, 42, 15, 5589, 2, NULL, '电线的排布，请监理老师看看是不是存在很多问题,谢谢！', 1349655253, 703, 0, 1, 0, 0, 0),
(60, 42, 14, 5589, 2, NULL, '请监理老师看一下，电的排布是否有问题，谢谢！', 1349655601, 704, 0, 1, 1, 0, 0),
(61, 32, 14, 2705, 1, NULL, '请问监理师，房子装修的话用PPR、不锈钢管、铜管、铝塑管哪个更好？PPR管可以用作暖气管道吗？', 1351042282, 889, 0, 2, 0, 0, 0),
(62, 53, 14, 0, 2, NULL, '我家装修工人在装五金件不小心钻孔钻到了电线，当时家里电闸就跳掉了，把电闸开关往上合都合不上，后来在钻孔的地方用起子拨弄了几下，电闸可以合上，照明都好了。工人解释说可能是把一根电线皮钻破了，搭在了管子上，所以跳闸。但是这种情况会不会有安全隐患，会不会经常跳闸或引起失火啊？', 1351042936, 890, 0, 1, 1, 0, 0),
(63, 53, 14, 0, 2, NULL, '三脚插头的地线如何接地呀？进入插座的就是两根线么，火线零线。使用三角插头的电器插在插座上。万一漏电接地线如何起作用呢？', 1351214774, 919, 0, 1, 0, 0, 0),
(64, 32, 14, 2705, 2, NULL, '我家装修时，部分电线直接埋入墙壁中没有套管，请问这样有没有隐患，有多大程度的隐患？热胀冷缩对电线的寿命有没有影响，会不会漏电？这样电线的寿命有多长？', 1351215332, 920, 0, 1, 0, 0, 0),
(65, 53, 15, 0, 2, NULL, '我家装修时，部分电线直接埋入墙壁中没有套管，请问这样有没有隐患，有多大程度的隐患？热胀冷缩对电线的寿命有没有影响，会不会漏电？这样电线的寿命有多长？', 1351821095, 1068, 0, 1, 0, 0, 0),
(66, 32, 15, 2705, 2, NULL, '请问卫生间和厨房能包木门套吗？会不会受潮变形？', 1352692714, 1205, 0, 1, 0, 0, 0),
(67, 74, 15, 0, 1, NULL, '请问全程监理收费标准是按建筑面积还是套内面积?另外监理公司怎么为我们保证家装质量呢?', 1353301635, 1432, 0, 1, 0, 0, 0),
(68, 74, 14, 0, 1, NULL, '请问监理方怎样防止工人偷换材料呢?怎样预防工人在布电线时候采用前几家的剩余电线接线头拼接?这样拼接出来的电线对日后的使用会有影响吗?', 1353301825, 1433, 0, 1, 0, 0, 0),
(69, 76, 15, 0, 1, NULL, '你好，请问你们有其他的点吗？看收费的时候好像有看到说：外环以外易监理服务站2公里以内免收交通费，这些点在哪里啊？', 1354096924, 1605, 0, 1, 0, 0, 0),
(70, 93, 14, 3809, 1, NULL, '我想问下 我1月初就可以拿新房房子在宝山顾村下去美兰湖远洋7号，这样的话 ，贵公司是不是也免收交通费的呢？\n另外，贵公司现在监理服务全程打78折，说按照套内面积还是建筑面积呢？ 包括那些服务呢？', 1355758643, 2187, 0, 1, 0, 0, 0),
(71, 74, 14, 0, 2, NULL, '请问常工,地线必须连接水管吗?是什么原理呢?大家对这个问题的说法似乎很不一致.', 1357541231, 2831, 0, 1, 0, 0, 0),
(72, 108, 15, 0, 1, NULL, '莘庄地铁的房子，三室两卫，110平，全程监理的话价格大概是多少啊。', 1357644979, 2832, 0, 1, 0, 0, 0),
(73, 116, 14, 0, 1, NULL, '1、咨询价格：松江新桥，建筑面积180,3+1，室内面积预计250左右，全程监理请问价格大约多少？如果只做隐蔽工程监理价格大约多少？\n2、你们78折的优惠大约到什么时候结束？\n3、你们全程监理一般去几次？还是应客户的要求才会去？', 1358214210, 3223, 0, 2, 0, 0, 0),
(74, 123, 15, 3753, 1, NULL, '请问我建筑面积是120.7，121平方不到。全程监理是什么价格？能否参加78折活动？', 1358517059, 3542, 0, 1, 0, 0, 0),
(75, 123, 15, 3753, 1, NULL, '你好，121以上是60每平，那我120.7，是不是按50每平来计算的？', 1358942674, 3864, 0, 1, 0, 0, 0),
(76, 135, 15, 0, 2, NULL, '你好，请问桩基础剪力墙结构是不是所有承重墙都不能动，因为大部分都是承重墙，那承重墙上开个门，做好加固，不动上边的梁，行不行？谢谢！', 1359522681, 4180, 0, 2, 0, 0, 0),
(77, 137, 15, 0, 1, NULL, '监理的费用是按建筑面积还是实际使用面积啊', 1362386342, 4559, 0, 1, 0, 0, 0),
(78, 149, 96, 1786, 2, NULL, '图片中水箱底部两个金属面是否需要用膨胀螺丝打在地面上固定水箱？', 1363102034, 4879, 0, 1, 0, 0, 0),
(79, 165, 15, 0, 2, NULL, '请问材料品质问题是否属于监理监察范围之内？', 1363439258, 4977, 0, 1, 0, 0, 0),
(80, 170, 15, 3995, 1, NULL, '你好，我买的是二手房，带装修，但装修时间有近十年了，上家的地板、楼梯都还不错， 不打算动，但墙面，厨房，卫生间进行翻新，电路和水管不知道要不要动，面积265平米。这样翻新大概多少钱可以做下来啊？', 1363702234, 5152, 0, 1, 0, 0, 0),
(82, 156, 14, 0, 1, NULL, '一室一厅毛坯38平使用面积半包预算在多少合适？ 哪些品牌的主材性价比较高？', 1363760423, 5155, 0, 1, 0, 0, 0),
(83, 179, 15, 3646, 1, NULL, '我家建筑面积55个平方，老房完全翻新重新装修，在犹豫是否要请监理，如何请监理性价比比较高，能适合我们的情况。目前我们还处于设计环节。', 1364113482, 5237, 0, 1, 0, 0, 0),
(84, 186, 15, 0, 1, NULL, '老师，您好！目前我家处于施工初期，开槽打洞阶段，看到网上开槽都非常的工整，我们家的开的和狗啃一样，请问这个问题大吗？另外，施工队用的PVC的六分管，请问四分管够了吗？', 1365326052, 5958, 0, 1, 0, 0, 0),
(85, 186, 96, 3846, 2, NULL, '目前家里在开槽阶段，我看人家家里开槽都非常漂亮，我们家怎么和狗啃一样，这个有问题吗？', 1365327543, 5967, 0, 1, 0, 0, 0),
(86, 187, 15, 5798, 1, NULL, '想请教下，监理大师们看了那么多施工现场，感觉哪几家装修公司相对较好，能推荐下嘛？', 1365488591, 6147, 0, 1, 0, 0, 0),
(87, 221, 16, 0, 1, NULL, '请问，厨卫的旧墙砖敲掉后，是否需要做找平粉刷，有些公司预算里有，有些没有，贴墙砖的报价都是差不多的。', 1366425185, 6628, 0, 1, 0, 0, 0),
(88, 187, 0, 5798, 2, NULL, '各位法师好，想咨询下电路重排与增排的问题：所谓重排是不是根据设计后的开光插座灯的位置，重新从强、弱电箱开槽、布套管、穿买来的电线？一般装修都采用重排吗？还有买的是新房，装修公司建议利用原有电路的套管，不开槽，只更换电线，需要重新开槽的再开槽，不知这样是否有隐患？多谢多谢', 1367341115, 6919, 0, 0, 0, 0, 0);
INSERT INTO `yjl_j_qz_topic` (`qztid`, `qzid`, `uid`, `content`, `datetime`, `tid`, `iszj`) VALUES
(1, 1, 16, '你好，如果你面积在130平米以内，你可以考虑选择“12步精监理”费用仅需2980元，性价比极高；\n如果你时间不是很充裕的话，建议选择全程监理（ 50元/平方X建筑面积，4500元是起步价，外环再加10%的交通费），其他服务项目可致电4009902013咨询', 1346898878, 452, 0),
(2, 2, 16, '监理是受业主委托代表业主（甲方）对施工方进行监督，对装修质量、装修进度及费用等进行控制和管理\n\n的。当然具体的工作有很多，比如审核预算、开工交底、水电验收等。详情可以来电咨询4009902013。', 1346900374, 473, 0),
(3, 3, 16, '首先所有的验收业主都应该参加，如果业主不能到场，易监理工作人员会将现场情况进行拍照，对验收结果做好记录，并且将施工照片和监理报告提交到易监理网上，业主随时随地可以查看自己家的进展照片和监理报告，也可以将这些资料分享给任何专业人士加以点评，我们只能公正的做好自己的工作。', 1346900710, 475, 0),
(4, 4, 16, '现今，装修行业竞争激烈，装修公司一旦抓到单子，装修公司必然会狠宰业主，如果业主不懂装修知识必然会吃亏，其实找易监理是不花钱的，易监理专业团队从预算中直接帮业主省钱，在装修过程中更是防止偷工减料，防止不合理增项，恶意变更项目，这将省掉业主很大一部分费用，更重要的是找监理还能节省你很多的时间，装修品质也将得到很大的提升。', 1346900760, 476, 0),
(5, 5, 16, '易监理是这样验收的：新增的给水管道必须进行加压试验，使用水压泵加压至0.6MPa，塑料管恒压1小时，压力下降不应大于0.05MPa。现在不少水管为证明自身品牌的质量都将标准提高不少，一般做到加压0.8~0.9MPa，塑料管恒压45分钟，压力下降不应大于0.1MPa。业主在验收时也可以作为参考。', 1346900881, 477, 0),
(6, 7, 14, '你好，其实你不知道所有装潢公司的施工队都是外包的，施工队长对工人的监管都是有限的，追求利益是他们共同唯一的目标，你的这种情况我们也很无奈，这种现象其实很普遍，易监理注重过程控制，对每个项目的施工工序和工艺都有严格的审查，对施工现场都要拍照并且上传到易监理网上，相信在我们的管理体系下，这种现象肯定是不会发生的。', 1346901522, 483, 0),
(7, 8, 14, '你好，全程监理除软装外，其他都参与，更多细节问题你可以咨询：4009902013 或者到我们公司来寻求帮助。', 1346901676, 485, 0),
(8, 9, 16, '易监理监理服务包括对材料的验收。建议你留好证据，如果材料是假的，那么这样的公司后面肯定还会有其他问题，前面一定要严格，强硬，不然后面他们会更加猖狂，你应该趁早找监理来协助你，避免后面更严重的问题。更多细节问题你可以咨询：4009902013 或者到我们公司来寻求帮助。', 1346901841, 486, 0),
(9, 10, 16, '易监理审核预算主要是将不该有的项目去除，将重复收费的项目去除，另外重点是要看是否有漏项，如有漏的要加上去，还有包括对主辅材，人工单价虚高部分加以调整，主辅材料明确标明，以保证品质。易监理审核预算服务还包括协助签订装修合同，站在业主的立场添加一些补充条款，对将要发生的或者可能会发生的问题，事先约定好解决办法，避免以后纠纷。如果可以我建议你到我们公司来详细了解！', 1346902160, 487, 0),
(10, 11, 14, '你好，我不知道水电工完工验收时，施工队是否有提前通知你验收，如果没有通知那么就是他们操作有问题，如果他们有通知多少天内必须到现场验收，而你确实没时间的话，可以与装修公司协商，如果你没有和装修公司协商而超出规定时间的话就比较被动。', 1346902419, 488, 0),
(11, 12, 14, '这样的装修公司肯定有问题，选择这样的装修公司一定要请监理，防止后面施工中的增项，漏项，恶意变更项目，偷工减料等问题。对业主来说优惠不重要，重要的是一定要合理。', 1346902541, 492, 0),
(12, 13, 14, '可以的，我们的监理服务包括对材料的验收。', 1346902599, 495, 0),
(13, 14, 14, '你好，施工合同已经签了，那单价就无法修改。其实前期预算这个还不是最重要的，更重要的是：对施工质量的控制，施工中增项和漏项的控制，及决算中合理化的调整。装修公司要求签了合同，才能给预算，这个是不对的，这个时候建议你请监理，免得业主吃亏。', 1346902661, 498, 0),
(14, 20, 14, '大理石按辐射程度的强弱大致分为三个级别，家庭装修要选择A级石材，因为A级大理石辐射极小，不会对人体造成影响，可以在室内使用。B级大理石对人体健康有一定影响，只能用在大厅，走廊等室内公共场所；C级大理石是对人体有严重危害的石材，绝对不能用与室内空间,，只能用在户外的道路和广场。易监理建议：尽可能减少在室内使用大理石，局部采用的话尽可能选择国标内的材料，这不是小问题，希望业主重视。', 1346902888, 506, 0),
(15, 26, 14, '这是装修公司希望他们的工地不要有任何监管好钻空子，这样的装修公司要更加警惕。别的监理公司我们不管，但是易监理的体制设计就必须要求监理人员公正的服务于业主，上易监理网业主可随时随地看自己家的装修进展和监理报告，业主也可以分享给任何人来对我们的工作进行点评，如果我们的工作有问题，在互联网微薄环境下，将会很容易曝光，我们只能做好，装修公司也只能做好，不然他们很难在业内生存。', 1346902973, 509, 0),
(16, 44, 14, '每个公司标准不一样，人工费偏差太大会有一些问题，建议你有空的话可以把预算拿到我们公司来看看。\n公司地址：上海市杨浦区国康路46号3号楼1002室，电话：4009902013', 1346903017, 512, 0),
(17, 40, 14, '一般开发商提供的墙面涂料都不太好，容易造成开裂、脱皮，所以在这种表面上做基层不太牢靠以后会产生遗憾，建议将其铲除。', 1346903113, 515, 0),
(18, 48, 16, '你好，签了装修合同，单价估计很难调整。其实前期预算这个还不是最重要的，更重要的是：对施工质量的控制，施工中增项和漏项的控制，及决算中合理化的调整，我们建议你可与我们洽谈合作，签订2980元的监理服务合同，对后面的事项加以控制。', 1346908252, 517, 0),
(19, 47, 16, '它的封法和其他开槽的水电管一样，可以将槽的两边适当打毛处理，这样不易开裂。', 1346908278, 518, 0),
(20, 46, 16, '易监理全程监理提供验房服务，如果验房有问题，可让开发商整改，这也是对你很大的一个保障。在装修前也会根据我们的经验提供一些好的建议，越早找监理越好！', 1346908300, 519, 0),
(21, 45, 16, '易监理建议：先履行设计合同，设计符合要求后，在考虑预算和施工，设计图纸没做好，后面不确定性因素太多，会非常难做。', 1346908318, 520, 0),
(22, 43, 16, '你好，可以请监理，但是监理不陪同买材料，我们是独立的第三方监理', 1346908343, 521, 0),
(23, 42, 16, '水电示意、原始结构、平面布置等这些基本的图纸一般都不会缺，往往图纸的不齐全会体现在一些必要的节点图中，因为每个家庭的装修项目都不同，所以要根据实际情况进行判断，比如现浇楼板必须有配筋图，笼统的来讲，图纸是工人施工、监理验收的重要依据，根据这个图纸，工人必须能够很清楚地了解怎么做。', 1346908363, 522, 0),
(24, 41, 16, '装修公司并没有统一格式的模板，都由公司自主而定，一般每个公司都有自己的预算模板，如果审预算的话，我们是公寓房800元，别墅1000元，还包括对图纸的审核，装修合同的洽谈及签订。', 1346908392, 523, 0),
(25, 39, 14, '一般的流程是先设计后预算，分设计合同和是施工合同，有了完整的设计图纸后方可出规范的预算，试想没有吊顶图，在预算中怎么计算吊顶项目呢？如果你和他们签定了设计合同，在付清设计费用后，就理所当然把所有的设计图纸给你。易监理特别提醒：施工合同是另外一码事，没有道理说你要签定了施工合同，才能继续设计，这个一定要当心。监理公司在设计阶段介入是最好的，能够保证设计规范符合你的要求，最晚也要赶在和他们签施工合同之前，等监理审过预算，确认没问题后方可签字。一般设计确认后再来签施工合同，若设计达不到要求可以要求装修公司更换设', 1346908432, 524, 0),
(26, 38, 14, '你好，监理服务合同日期：开始日期就是签订合同之日算起，结束日期写装修合同上的竣工日期', 1346908461, 525, 0),
(51, 37, 14, '1， 监理合同是和监理公司签订 2， 费用易监理采用分期支付，我们鼓励业主用支付宝支付，洽谈合同及审核图纸，预算前公寓房你可以预付800元，别墅预付1000元，等我们服务完这一步时你在确认支付，后面的签订正式合同付一半，泥木工验收后确认支付到90%，工程竣工验收后确认支付到100% 3， 关于协助业主审核预算和洽谈装修合同我们服务次数最多两次，我们提供专业技术性服务，业主基本确定设计图纸后提供一些资料我们提供专业性建议，装修公司基本符合要求时我们上门协助业主审核及洽谈。详情可来电咨询：4009902013', 1347433113, 685, 0),
(28, 36, 14, '首先我们的监理都有国家证书，具有相关资质，其次上易监理网随时随地看你家的装修照片和监理报告，任何人都可以看并评论，或分享给任何专业人士，如果监理人员技术不到位或者与装修公司串通，结果就是不公正处理业主问题，在互联网微薄环境下监理很容易曝光，他不仅会失去较高的奖金而且在行业内都没法生存，这也是易监理采用明规则设计之巧妙。', 1346908512, 527, 0),
(29, 35, 14, '我们的监理团队每天都奔波在各个工地，装潢公司里的人有所耳闻甚至打过照面也很正常，但是这并不意味着认识就应该放水，易监理体制的设计只能公正，业主上易监理网随时随地都能看到自己家装修的进展照片和监理提交的报告，任何人都可以查看和点评，你也可以分享给专业人士，如果监理人员放水在透明的互联网环境下会很容易曝光，这样监理人员将无法在业内生存，相反请了我们监理，我们将运用互联网的强大背景对装修公司严格监管，大大提升装修品质。', 1346908533, 528, 0),
(30, 34, 14, '有太多不一样的，第一：我们是独立的第三方监理区别于装修公司送的监理；第二：我们的监理采用澳洲过程监管系统，强调过程控制，防范于未然；第三：我们的监理配合互联网模式，能极大的保证我们的公正性，在互联网模式监管下装修公司只能做得更好，这也极大的提升了装修品质。我们是真正的第三方监理。', 1346908553, 529, 0),
(31, 33, 16, '很多大的装潢公司都不愿意让你把预算带出来，你只有在他们公司审，如果你请了监理的话，我们是可以陪你上门审预算的。', 1346908590, 530, 0),
(32, 32, 16, '你好，我不知道你现在在纠结什么问题，其实你找易监理是不花钱的（易监理专业团队帮你审核预算，剔除重复多收项目，在施工过程中帮你控制增项，漏项，这些将帮你省很多钱，省下钱的一小部分支付监理费就可以了），而且还能节省你50%的时间，装修品质也将得到很大的提升，相反你不请监理，自己如果也不懂装修知识，将会有很多危害。找监理最好在找设计师之前，越早越好。', 1346908607, 531, 0),
(33, 31, 16, '你好，别墅监理我们有21步精监理和全程监理，全托式监理。根据你选择的服务类型我们会按照服务合同规定次数到达工地现场，全程监理我们必须一周到达三次，全托式监理我们一周去六次，这个不会受到工期长短影响 。', 1346908627, 532, 0),
(34, 30, 16, '不是的。为了确保你的利益，监理费用可以采用支付宝按装修进度分期支付的', 1346908643, 533, 0),
(35, 29, 16, '一般由装潢公司根据设计图纸出具详细的报价。至于你说的情况，我想大多数装潢公司都不会同意的，毕竟设计师在里面也付出了劳动力，具体费用理应在设计之前谈好。', 1346908659, 534, 0),
(36, 28, 16, '你好，可以的，详细的可以来电4009902013咨询，最好到我们公司来。', 1346908675, 535, 0),
(37, 27, 16, '你好，主要分投资控制：让费用在预算之内；质量控制：防“豆腐渣”工程；环保控制：避免装出毒气室；工期控制：让您安心进爱巢，当然在施工前期对图纸的审核，装修合同的洽谈及签订等等细节问题也都在服务范围内的。收费标准根据公司规定，详情来电咨询：4009902013', 1346908701, 536, 0),
(38, 25, 16, '我们是独立的第三方监理，我们只接受业主委托，我们承诺不接受任何装修公司业务。', 1346908723, 537, 0),
(39, 24, 16, '我们严格按国家标准验收，如果验收时出现质量问题，我们会派发整改单，要求施工方在规定时间内进行整改，如装修公司不配合我们将对出现问题部分拍照，取证，根据合同进行索赔，并将出现问题部分在易监理网上公布，这样所有人都能看到他们的问题，相信在易监理透明的互联网环境下装修公司是不敢作恶的。', 1346908739, 538, 0),
(40, 23, 14, '可以签订信用保证书，监理合同是和监理公司签订，如果我们的监理人员与装修公司串通，造成业主损失的，将由监理公司来承担责任。', 1346908784, 539, 0),
(41, 23, 14, '你好，像这样的情况其实双方都有责任，在没有决定性证据的情况下，监理建议请地板厂商鉴定下有多少地板是无法正常使用的，确定数量后将“坏”地板折旧退给厂家（厂家可以再利用的），差价部分由装修公司和你各承担一定比例的费用重新购买一批地板。因为你有支付材料管理费，所以装修公司的赔偿比例相对会高些。', 1346908801, 540, 0),
(42, 22, 14, '你好，像这样的情况其实双方都有责任，在没有决定性证据的情况下，监理建议请地板厂商鉴定下有多少地板是无法正常使用的，确定数量后将“坏”地板折旧退给厂家（厂家可以再利用的），差价部分由装修公司和你各承担一定比例的费用重新购买一批地板。因为你有支付材料管理费，所以装修公司的赔偿比例相对会高些。', 1346908832, 541, 0),
(43, 21, 14, '任何送的免费监理都不是独立的第三方监理，是“僞监理”，他是送的那谁来支付他的服务费用？易监理与他们的区别在于:我们不和任何装修公司挂钩，我们只接受业主方委托。', 1346908849, 542, 0),
