(45, 18, 14, '你好，你可以先咨询我们的QQ或电话先了解一下我们的服务内容及收费标准，我们可以先传一份合同样本你先看一下，没问题后你可以到我们公司来签订正式监理服务合同，或者预约我们工作人员上门签订合同，然后我们就可以根据合同来执行监理服务。', 1346908884, 544, 0),
(46, 17, 14, '你好，易监理是独立的第三方监理公司，不管任何监理类型我们都不陪同买建材。', 1346908899, 545, 0),
(47, 16, 14, '你好，加钱与否是根据造成原因的责任来认定的，如果是装修公司的责任那应由装修公司买单。如果是业主的责任那就由业主承担，如果双方都有责任，那根据责任轻重按比例承担。越正规的大公司，在这方面会相对好些，越小的又不太正规的小公司容易发生扯皮或不讲理的情况。建议在签定合同时可以明确返工赔偿责任的问题。易监理注重 过程中控制，先告知施工方监理检查的内容和会出现的问题及预防措施，这样避免后面出现重大问题。', 1346908916, 546, 0),
(48, 15, 16, '不可以，每个节点都必须由业主参加验收，签字后方可进行下一步的工程，如果全面没有验收，特别是隐蔽工程如果当时没验收就封闭了，这样只能检查饰面工程，无法判断里面的质量是否合格。易监理强调过程控制，防范于未然，每个阶段，每个小项目必须严格验收合格后方可进行下一步工序。', 1346908948, 547, 0),
(49, 54, 14, '明显的设计不规范，很多业主对设计图纸不懂，很多设计不符合规范，不符合人体功学要求，建议在找设计师时就请监理来协助。', 1347428571, 683, 0),
(50, 49, 14, '你好，我们全程监理服务包括验房，单独验房服务我们不做。', 1347428693, 684, 0),
(52, 53, 14, '你好！第一张照片存在两个问题：1，单线与单线连结没有用阻燃压线帽；2，导线接头不能直接埋在墙体内，应使用过渡暗盒。第二张照片有一个问题：抹灰时加强措施没有造成开裂，应该用丝网两边连接。', 1347435693, 686, 0),
(55, 55, 15, '我从业20多年，可以负责任的告诉你，装修最忌讳的就是不确定性，最重要的是设计定下来，再告诉你一个残酷现实，目前家装公司的设计师实际上是销售，设计可能都是他的助理做的，但收了设计费，就可要求提供规范的设计图纸，不惜开工延后，最好有监理帮你把关，设计确定，在施工中的变更或增项将会很少。', 1347499215, 690, 0),
(56, 56, 15, '你好，第一张照片强弱电线管分色，比较好，便于验收检查，但是从照片上看线管间距太小，应该按照装修行业质量标准执行。 第二张，门套垫层在施工，但从照片上看，1，门套另一边敲墙部位还没有粉平直，应该将粉层粉平直，水泥浆干后在做门套垫层，2，里面的一个门窗套垫层来看，门套上部竖板垫层较宽，门套线盖不住原老墙面，后道工序油漆时应特别注意，应将门套盖在石膏板上或盖在原老墙面上，日后油漆开裂的概率将大大减少。', 1347602020, 692, 0),
(58, 58, 14, '你好，由于照片不是很清楚，但从目前照片上所反映的情况来看：第一张照片下水管边上的线管有一段是用4分管与6分管相接，这个不妥，正确做法是每端用一个6分直接，再连一根6分管上去。第二张照片：第一个就是出水端口10公分左右应固定；第二个两个暗盒之间间距是否太小?可能造成以后面板安装时装不上去；第三个两个暗盒中间应用锁扣连接或者放一段6分管，以免用水泥固定线盒时把电线一起埋进去；第四个照片最下面的一根水管水表两端的水管也应该在验收前固定好！', 1349661375, 705, 0),
(60, 60, 14, '由于照片不是很清楚，对于第一张照片建议你检查下：1，线管是否有进配电箱？2，线管和配电箱是否是用锁扣连接的？3，接地线照片上用的是黄色线，应该用双色线。4，配电箱上的护套线不知有何用处，似乎有不妥。5，自己检查下配电箱下的线管是否有进墙体8-10毫米？；第二张照片，左边强电，右边弱电，中间好像是空了一个暗盒的间距，不会造成强弱电干扰，比较规范。（空的那个暗盒应该拆除或者把边缘一圈拆掉，以免造成涂料做完以后前面开裂）；第三张照片，请你检查下，线管固定间距是否80公分左右，线管进墙体是否8-10毫米？', 1349662841, 707, 0),
(61, 61, 14, '用什么材料更有利弊，铜管能够产生对人体有益的微量元素，但是造价较高，使用寿命没有PPR管长，施工工艺要求也比较高。PPR管施工方便，造价比铜管低，使用寿命长。基本上选择PPR管。', 1351059202, 891, 0),
(62, 61, 14, 'PPR管不可以做暖气管道，PPR管热阻较大，不易传导。', 1351059267, 892, 0),
(63, 62, 14, '如果是你说的这种情况，以后会经常跳闸，而且墙体上可能会带电，这个修补要把里面破损的电线换掉。', 1351060391, 893, 0),
(64, 63, 14, '配电箱内有接地保护装置，接地线接到保护装置上就可以了，如果漏电，漏电保护器会跳闸的！', 1351241936, 927, 0),
(65, 66, 15, '可以包，但要有措施：门套底部留3毫米用硅胶做掉，这样便不会受潮变形。', 1352959225, 1382, 0),
(66, 65, 15, '肯定有隐患，但是不一定发生。', 1352959330, 1383, 0),
(67, 59, 15, '。。。', 1352959347, 1384, 0),
(68, 64, 14, '肯定有隐患，多大程度是不好形容的。', 1352964638, 1385, 0),
(69, 67, 15, '你好，我们监理收费按建筑面积计算。我们公司在整个监理服务过程中，拥有非常完善的质量管理系统，将整个装修细分为各个关键点，在质量上对各关键点加以管控。监理师做到：质量控制，费用控制，工期控制。具体收费标准和服务内容欢迎来电咨询400-990-2013！', 1353314587, 1451, 0),
(70, 68, 14, '我们在每个阶段材料进场时都会按照预算约定对材料进行验收（品牌，规格，数量等），在施工中我们也会看材料的使用情况，如果发现时假的我们肯定会告知业主方；布线这些节点项目上我们都会到现场查看；拼接电线代替新线肯定对日后使用有影响，隐蔽工程出现这些问题的话会非常麻烦，像你说的这些是最容易出现问题的，也是我们重点检查的地方。', 1353315709, 1452, 0),
(71, 69, 15, '你好，我们目前有两个点，一个在宝山顾村，第二个点在宝山杨行，目前我们也在试运行阶段，根据情况会逐步增加服务点。目前我们在篱笆网上有做一些活动，现在报名参加会有一些折扣，会比较优惠，如果你还有不清楚的情况，欢迎您来电咨询，400-990-2013。', 1354247973, 1628, 0),
(72, 70, 14, '你好，外环以外我们收取10%监理费作为交通费，我们所有的收费均按建筑面积计算，这样会比较准确。全程监理服务内容包括：审核装潢公司，审阅图纸，审核预算，协助业主上门洽谈装修合同，施工中对施工质量，工期进度，装修费用加以控制，对进场材料验收和协助业主洽谈最终决算等等。另外全程监理我们还赠送两次室内空气污染检测（主要针对甲醛）。宝山区域目前是我们监理服务重点区域，由我们易监理总监常工带队负责，如有时间也可参观我们监理服务的工地案列。更多咨询也来电：4009902013', 1355817363, 2255, 0),
(73, 72, 15, '你好，我们全程监理按建筑面积计算，120平以内50元/平。目前我们在篱笆网上有做78折优惠活动，你可以预约。具体的情况，欢迎你来电咨询，400-990-2013', 1357713358, 2833, 0),
(74, 71, 14, '这种做法是不科学的，以前没有接地线，水管大多是金属的，所有会有这种做法。现在水管大多用PP-R管，是塑料的根本不导电，这样做就不对了！', 1357719384, 2834, 0),
(75, 73, 14, '你好！根据你所描述情况，你房型应该是联体小别墅，地下室面积大概在70平米左右，赠送面积我们减半计算，全程监理别墅和复式房型，300平米以内全程监理我们80元/平，篱笆网78折优惠截止日期2013.1.15号，你可以先预约，开年装修同样可享此优惠活动。全程监理一般一周三次现场服务，次数是要根据现场的施工情况，如果非常重要的地方我们有时候会超过三次，我们一个原则：对工程质量全面把关，而不是服务次数到了就不管现场质量。', 1358219515, 3237, 0),
(76, 73, 14, '对于你提出只做隐蔽工程阶段，我们可以根据业主的需求定制监理服务，我们针对250平米以内的别墅及复式房型有推出一个21步精监理套餐服务（8980元），针对开工后提供21次现场高品质服务，性价比较高。更多详情可电话联系400-990-2013', 1358219757, 3238, 0),
(77, 74, 15, '你好！全程监理我们120平米内50元/平，121-150平米60元/平，78折活动第一波1.15号结束，但是目前非常多的业主打算在年前跟装潢公司签约，考虑到业主在图纸，预算和签施工合同时专业性不够，我们也想更好的帮业主把好图纸关，预算关，和施工合同关，也应广大业主要求，我们78折优惠活动第二波将持续到2013.2.28号，所有你现在还可以参加我们在篱笆网上的报名活动，如有不清楚之处可电话咨询：400-990-2013', 1358578534, 3543, 0),
(78, 75, 15, '你好，根据你提供房屋讯息我们可以按50元/平来计算', 1358991727, 3892, 0),
(79, 76, 15, '不好意思，前面较忙，没来得及回答你的提问。承重墙开门洞要经过原设计单位或比原设计单位资质更高的设计单位作出加固方案，才可以，否则不然。', 1359610423, 4202, 0),
(80, 76, 15, '下面的说法是国家规范要求，根据监理师经验还有其他的一些处理方式，希望你能够来电咨询：400-990-2013', 1359610554, 4203, 0),
(81, 77, 15, '影响监理费用的因素很多，要看服务的深度和广度，面积只是其中的一个参数。目前我们公司是按照建筑面积来框算，然后给予78折。具体细节可来电咨询400-990-2013.', 1362386944, 4560, 0),
(83, 78, 96, '墙面能固定，尽量不做地面固定，如果要做地面固定也可以，但要做双层防水，并且楼层厚度要达到标准。', 1363401911, 4973, 0),
(84, 79, 15, '监理师会按照预算清单，对进场材料加以验收！', 1363677381, 5126, 0),
(85, 80, 15, '你好！第一，不知道你原来的水管和线管用得是什么材质的材料，要考虑原材料的使用寿命。第二，如果要动原来的水管，电路要知道原来的电路和水路的走向情况，看是否会影响其它不动的项目。你可以让设计师帮你设计两套方案，动与不动的利与弊以及可行性要权衡一下！', 1363743582, 5153, 0),
(86, 82, 14, '房子是新房还是二手房？厨卫面积多大？采用怎样的工艺去做（一、铲老粉尘铲到红砖，再用砂浆水泥抹灰，价格要高一些；二、如果采用瓷砖的品牌好一点，价格也同比上涨；三、看你洁具等材料是否上档次，价格在原有基础上也会略高）', 1363785719, 5178, 0),
(87, 83, 15, '你好！老房翻新不同于毛坯房装修，在施工工序和工艺上有很多的特殊要求需要注意，同时在装修预算上每个项目都需要备注明确，以免在开工后出现纠纷，这些特别提醒你一下。对于是否请监理，需要看你自身的情况，如果自己懂一些，时间也较充足，也可自己把关，请我们做全程监理，我们会根据你房屋情况对整个设计图纸把关，对预算上帮你做详细审核，也会陪你去装修公司签订施工合同，开工后主要对材料质量，施工质量，和工期进行把关，行业里不管面积多大全程监理都是有一个起步价，目前我们公司全程监理起步价3500元，详细的细节你可以来电咨询40', 1364175956, 5267, 0),
(88, 84, 15, '开槽最好的方式是开成锯齿形，这样封槽时吻合度较好，能避免以后开槽处出现开裂现象，对线管使用6分管还是4分管要看你穿线的多少，规范要求管内导线的总截面积不应超过管内截面积的40%，如果穿线较多还是建议用6分管，但是型号建议用315的，315的比215的管壁要厚，这样比较结实耐用。', 1365386896, 6026, 0),
(89, 86, 15, '非常感谢你对我们的信任，但是我们可能要对你说抱歉！首先作为独立的第三方监理，我们不推荐任何装修公司，其次，任何装修公司都有好的设计师和施工队，也有不是很好的施工队和设计师，我们不能以一概全，最重要的是要好的设计师和好的施工队来为你服务！', 1365566633, 6168, 0),
(90, 87, 16, '瓷砖敲掉以后，贴墙砖看是用什么方式来贴，如果用粘结剂贴肯定是要找平，如果用水泥胶水贴的话要看敲掉以后的平整度情况，如果敲掉后很不平，也是需要找平的，就我们目前来看，很多装修公司在预算里面都有这项，预算里面做出来是可以的，但是要看现场情况，确实需要找平的，那么就要盯住装修公司一定不要偷工减料。', 1366596499, 6660, 0),
(91, 85, 96, '本图显示开木槽不构专业，手势定位不正，应该横平上下直线，且做大弯，不宣小弯，管内线排放应能放活线，方便检修。', 1366932011, 6821, 0);
