INSERT INTO `yjl_j_xq_topic` (`xtid`, `tid`, `xqid`, `uid`, `cid`, `datetime`, `content`) VALUES
(117, 680, 5769, 10, 0, 1347263316, '某公司男同事行为准则——HOLD不住啊，女人们有福了~'),
(114, 677, 5769, 7, 0, 1347262954, '上海6月新建商品住宅价格指数结束此前连续8个月的降价势头，与5月相比上涨0.2%。是喜是忧？'),
(115, 678, 5769, 13, 0, 1347263125, '在中国，如何才能赚到钱买到房子？在中国，只要跟着国家政策走，基本上都是对的，政策鼓励你干什么，你干什么就是了。如果你是所有人中最先吃螃蟹的，你赚得就最多。'),
(116, 679, 5769, 8, 0, 1347263207, '从09年小赚一笔之后，就一直亏损，亏的我心都死了。不是说金融危机过了吗？\n不是说中国经济总体向好吗？为什么除了跌啥都没有？？\n温总，你不是要稳定中国经济形式的吗？难道就要一直把我坑下去！！\n在中国，买什么也别买股票，买点彩票也还能赚个十块八块的！！！'),
(112, 675, 3584, 5, 0, 1347262799, '咱们小时候与外国孩子的差距原来在这里：'),
(111, 674, 3584, 3, 0, 1347262527, '昨天某会议上，上海统计局表示，上半年本市城乡居民收入增长加快，就业形势总体平稳。\n抽样调查显示，上半年城市居民家庭人均可支配收入20689元，比上年同期增长12.5%，剔除价格因素后增长8.6%，其中，工资性收入增长12%。\n\n我再再再一次严重的拖了后腿，去年到今年工资几乎没涨过！！！！'),
(110, 673, 3584, 2, 0, 1347262296, '从别的论坛看来的\n\n\n\n上海：今年确定调整102条公交线路 暂缓调整13条线路 顾村地区527公交线调整方案已定，待镜泊湖路及陆翔路修路工程结束后实施。原菊盛路50弄对面527公交终点站撤销，更改为社区巴士站'),
(108, 670, 3584, 22, 0, 1347262099, '最近小区里很多新住户或者在装修房子的，房子装修完也就产生了很多废旧的垃圾，看看\n\n这些在路边一堆堆的砖瓦泥块都是！有的都已经堆了好久了，亲爱的邻居们，你们谁家的垃圾\n\n能不能及时清理掉啊？实在是有碍我们小区的干净整洁美观啊！'),
(109, 672, 3584, 2, 0, 1347262217, '随着 房产限购   相关行业  已经吃不消了\n\n电器类产品需求 持续下降  应该说是这次价格战的原因  而根本性原因还是房产的不景气引起内需减弱\n\n最后 玩下去 还是企业吃不消  企业吃不消 那就是裁员\n\n\n房产限购  再这么玩下去  与其相关的产业链 都突然被阉割了  然后 再恶性竞争  经济必然持续恶化'),
(104, 664, 3584, 18, 0, 1347260711, '不止在我们大家园，我发现很多小区里面都有这种小型的便利商店！\n    有的是合法经营，有的我进去购物时特意看了下，没有看到任何营业执照和资质证书之类的东东！难道这是被默许的吗？小区物业和居委对这些小店是什么态度，这不会产生什么食品安全隐患吗？'),
(102, 660, 3584, 19, 0, 1347260440, '现住小区用的是电信的宽带,好像还是光纤, 却经常连不上网,不知道未来叶语是跟哪个运营商配合?'),
(101, 659, 3584, 19, 0, 1347260061, '保利叶语，我的新家，很期待入住呢！'),
(100, 579, 3584, 21, 0, 1347005355, '叶语和夜上海在2个大盘,到现在还没看到重视教育,学校迟迟未建,到现在还没动工,估计叶语交房了,小孩多没有地方去,可怜的孩子们!没人重视你们,希望看到这篇帖子的人多顶一个,不这个消息赶紧传出去,让有关部门来重视下...所谓的批文光说不行动,没用的不能在拖延时间咯,时间过的很快的'),
(118, 700, 5291, 23, 0, 1348139590, '升级到iOS6之后iPhone和iPad可以直接上传图片了，太给力了');
