INSERT INTO `yjl_project_supervision` (`houser`, `worker`, `why`, `multiple_shop`, `office_building`, `laboratory`, `hotel`, `catering`, `factory`, `finance`, `school`, `building`, `other`) VALUES
('<img alt="" src="data/uploads/a//51c3d607f3ce5.jpg" border="0" /><img alt="" src="data/uploads/5//51c3d612caab7.jpg" border="0" /><img alt="" src="data/uploads/6//51c3d61cea272.jpg" border="0" /><img alt="" src="data/uploads/a//51c3d627e3a62.jpg" border="0" /><img alt="" src="data/uploads/0//51c3d632eebff.jpg" border="0" /><img alt="" src="data/uploads/5//51c3d63a9c1b0.jpg" border="0" /><img alt="" src="data/uploads/2//51c3d643291f6.jpg" border="0" /><br />', '<img src="data/uploads/2//51c7f9811bca5.jpg" alt="" border="0" /><img src="data/uploads/e//51c7f98b49292.jpg" alt="" border="0" /><img src="data/uploads/3//51c7f99958ba2.jpg" alt="" border="0" /><img src="data/uploads/3//51c7f9a99f803.jpg" alt="" border="0" /><img src="data/uploads/1//51c7f9b4eb2f3.jpg" alt="" border="0" /><img src="data/uploads/c//51c7f9bf44c95.jpg" alt="" border="0" /><img src="data/uploads/5//51c7f9ca1f58a.png" alt="" border="0" /><img src="data/uploads/e//51c7f9e14cb91.jpg" alt="" border="0" /><br />', '<p><b style="font-family:宋体;line-height:1.5;"><br />\n</b></p>\n<h1 style="text-align:center;"><b style="font-family:宋体;line-height:1.5;"><span style="color:#337fe5;">选易监理的五大理由</span></b></h1>\n<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>\n<h3><span lang="EN-US"><hr />\n</span><p><span lang="EN-US"><span style="color:#337fe5;"><br />\n</span></span></p>\n<p><span lang="EN-US"><span style="color:#337fe5;">APP</span></span><span style="font-family:宋体;color:#337fe5;">移动服务</span></p>\n</h3>\n<p><span style="font-family:宋体;mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;"><br />\n</span></p>\n<p><span style="font-family:宋体;mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;">&nbsp; <span style="font-family:''Microsoft YaHei'';">&nbsp;<span style="color:#666666;"> &nbsp;</span></span><span style="font-size:14px;font-family:''Microsoft YaHei'';color:#666666;">中国首家提供移动监理服务的监理公司，即拍即问功能非常强大，全国各地的装修业主，均可通过即拍即问功能，拍下你认为可能出现问题的照片（也可上传预算和图纸、整套照片），录下你的话，发给易监理在线高级监理师，</span></span><span style="font-size:14px;font-family:''Microsoft YaHei'';color:#666666;" lang="EN-US"> 10</span><span style="font-family:''Microsoft YaHei'';font-size:14px;color:#666666;">分钟以内提供即时语音回答和解决方案，目前处于测试期间，所有的问题均免费！</span></p>\n<p><span style="text-indent:0cm;line-height:1.5;font-family:''Microsoft YaHei'';font-size:14px;color:#666666;">&nbsp; &nbsp; &nbsp;易监理装备先进，所有监理师配备智能手机，移动</span><span style="text-indent:0cm;line-height:1.5;font-size:14px;font-family:''Microsoft YaHei'';color:#666666;" lang="EN-US">app</span><span style="text-indent:0cm;line-height:1.5;font-family:''Microsoft YaHei'';font-size:14px;color:#666666;">可以实现在工地上对施工内容的拍照和对质量现场语音点评，之后即可上传至云端。业主和易监理在线监理人员均可第一时间收到，可实现业主的第一时间知情并处理，也可实现易监理总部对监理师的服务质量的监督。</span></p>\n<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>\n<h3><span style="font-family:宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;"><hr />\n</span><p><span style="font-family:宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;"><br />\n</span></p>\n<p><span style="font-family:宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;"> <span style="color:#337fe5;">金牌监理师</span></span></p>\n</h3>\n<p><span style="text-indent:0cm;font-size:12px;font-weight:normal;line-height:1.5;font-family:宋体;"><br />\n</span></p>\n<p><span style="text-indent:0cm;font-size:12px;font-weight:normal;line-height:1.5;font-family:宋体;">&nbsp; &nbsp; &nbsp;</span><span style="color:#666666;font-family:''Microsoft YaHei'';font-size:14px;line-height:21px;">易监理的金牌监理师收入</span><span style="line-height:1.5;text-indent:0cm;font-family:宋体;"><span style="font-size:14px;font-family:''Microsoft YaHei'';color:#666666;">高出行业</span></span><span style="text-indent:0cm;font-size:14px;line-height:1.5;font-family:''Microsoft YaHei'';color:#666666;" lang="EN-US">20%</span><span style="text-indent:0cm;font-size:14px;line-height:1.5;font-family:''Microsoft YaHei'';color:#666666;">-50%，并且是通过严格考核筛选出来的；易监理树立金牌监理师个人品牌，他的收入是和业主的评价直接相关的，如果出现不负责任的服务，他们未完工的所有项目收入都会大幅下降，他们的个人品牌价值也会大幅下降，是得不偿失的；这样的机制保证了监理师对业主的精致服务和切实的提升装饰质量。</span></p>\n<p><span style="text-indent:0cm;line-height:1.5;" lang="EN-US"><br />\n</span></p>\n<h3><span style="text-indent:0cm;line-height:1.5;" lang="EN-US"><hr />\n</span><p><span style="text-indent:0cm;line-height:1.5;" lang="EN-US"><br />\n</span></p>\n<p><span style="text-indent:0cm;line-height:1.5;" lang="EN-US"> <span style="color:#337fe5;">20%</span></span><span style="text-indent:0cm;line-height:1.5;font-family:宋体;color:#337fe5;">质量提升</span></p>\n</h3>\n<p><span style="text-indent:0cm;line-height:1.5;font-family:宋体;"><br />\n</span></p>\n<p><span style="text-indent:0cm;line-height:1.5;font-family:宋体;">&nbsp; &nbsp; &nbsp;<span style="font-size:14px;font-family:''Microsoft YaHei'';color:#666666;">易监理施工工地做过一个实验，对比未选监理的</span></span><span style="text-indent:0cm;line-height:1.5;font-size:14px;font-family:''Microsoft YaHei'';color:#666666;" lang="EN-US">20</span><span style="text-indent:0cm;line-height:1.5;font-family:''Microsoft YaHei'';font-size:14px;color:#666666;">个施工工地，在</span><span style="text-indent:0cm;line-height:1.5;font-size:14px;font-family:''Microsoft YaHei'';color:#666666;" lang="EN-US">30</span><span style="text-indent:0cm;line-height:1.5;font-family:''Microsoft YaHei'';font-size:14px;color:#666666;">余项施工工艺、材料质量及安全性方面，易监理服务的工地质量明显优于没有监理监管的工地，作为一项工作，如果业主有兴趣，易监理开放正在施工中的工地，欢迎业主和没有监理的工地进行对比。</span></p>\n<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>\n<h3><span lang="EN-US"><hr />\n</span><p><span lang="EN-US"><br />\n</span></p>\n<p><span lang="EN-US"> <span style="color:#337fe5;">100%</span></span><span style="font-family:宋体;color:#337fe5;">省钱</span></p>\n<p><span style="font-family:宋体;mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;"><br />\n</span></p>\n</h3>\n<p><span style="font-family:宋体;text-indent:0cm;font-size:12px;font-weight:normal;line-height:1.5;">&nbsp; &nbsp;<span style="font-size:14px;font-family:''Microsoft YaHei'';color:#666666;"> 易监理在预算、决算及材料数量及质量上为业主省钱；</span></span></p>\n<span style="color:#666666;"> </span><span style="font-family:''Microsoft YaHei'';color:#666666;"> </span><span style="font-size:14px;font-family:''Microsoft YaHei'';color:#666666;"> </span><p><span style="font-family:''Microsoft YaHei'';text-indent:0cm;line-height:1.5;font-size:14px;color:#666666;">&nbsp; &nbsp; &nbsp; 易监理有专门的预算中心，主要为全国的装修的业主提供在线预算审核和预算规划服务。在上海提供线下的上门监理预算审核服务。</span></p>\n<span style="color:#666666;"> </span><span style="font-family:''Microsoft YaHei'';color:#666666;"> </span><span style="font-size:14px;font-family:''Microsoft YaHei'';color:#666666;"> </span><p><span style="text-indent:0cm;line-height:1.5;font-family:''Microsoft YaHei'';font-size:14px;color:#666666;">&nbsp; &nbsp; &nbsp;预算需要和图纸一同审核，根据图纸，核对材料数量和具体型号，核算多算和价格超高的项目，检查出漏项并要求复报；</span></p>\n<span style="color:#666666;"> </span><span style="font-family:''Microsoft YaHei'';color:#666666;"> </span><span style="font-size:14px;font-family:''Microsoft YaHei'';color:#666666;"> </span><p><span style="text-indent:0cm;line-height:1.5;font-family:''Microsoft YaHei'';font-size:14px;color:#666666;">&nbsp; &nbsp; &nbsp;决算上，按照按实结算原则，通过过程的监控和数量统计，帮助业主减去施工方重复计算的项目，核算出因为施工方的过失而出现的成本，汇总决算书。</span></p>\n<span style="color:#666666;"> </span><span style="font-family:''Microsoft YaHei'';color:#666666;"> </span><p><span style="text-indent:0cm;font-family:''Microsoft YaHei'';font-size:14px;color:#666666;">&nbsp; &nbsp; &nbsp;易监理目前进行预算审核一般可以实现</span><span style="text-indent:0cm;font-size:14px;font-family:''Microsoft YaHei'';color:#666666;" lang="EN-US">5%-10%</span><span style="text-indent:0cm;font-family:''Microsoft YaHei'';font-size:14px;color:#666666;">价格降低（除了漏算项），决算出现过最高近</span><span style="text-indent:0cm;font-size:14px;font-family:''Microsoft YaHei'';color:#666666;" lang="EN-US">50</span><span style="text-indent:0cm;font-family:''Microsoft YaHei'';font-size:14px;color:#666666;">万的别墅决算节省。</span></p>\n<span style="font-family:''Microsoft YaHei'';"> </span><p class="MsoListParagraph" style="margin-left:18.0pt;text-indent:0cm;mso-char-indent-count:0;"><span style="font-family:''Microsoft YaHei'';" lang="EN-US">&nbsp;</span></p>\n<h3><span style="line-height:1.5;text-indent:0cm;" lang="EN-US"><hr />\n</span><p><span style="line-height:1.5;text-indent:0cm;" lang="EN-US"><br />\n</span></p>\n<p><span style="line-height:1.5;text-indent:0cm;" lang="EN-US"> <span style="color:#337fe5;">A</span></span><span style="line-height:1.5;text-indent:0cm;font-family:宋体;color:#337fe5;">级信誉</span></p>\n</h3>\n<p><span style="text-indent:0cm;font-size:12px;font-weight:normal;line-height:1.5;font-family:宋体;"><br />\n</span></p>\n<p><span style="text-indent:0cm;font-size:12px;font-weight:normal;line-height:1.5;font-family:宋体;">&nbsp; &nbsp;&nbsp;</span><span style="font-family:''Microsoft YaHei'';line-height:1.5;font-size:14px;color:#666666;">易监理视网络口碑为生命！</span><span style="font-family:''Microsoft YaHei'';line-height:1.5;text-indent:0cm;font-size:14px;color:#666666;">易监理全国性大型装饰监理公司，在监理服务质量和互联网监理应用上，具有领先实力！</span></p>\n<span style="color:#666666;"> </span><span style="font-family:''Microsoft YaHei'';color:#666666;"> </span><span style="font-size:14px;font-family:''Microsoft YaHei'';color:#666666;"> </span><p><span style="text-indent:0cm;font-size:14px;font-weight:normal;line-height:1.5;font-family:''Microsoft YaHei'';color:#666666;">&nbsp; &nbsp; &nbsp; 目前上海易监理的家装服务已经覆盖</span><span style="text-indent:0cm;font-size:14px;font-weight:normal;line-height:1.5;font-family:''Microsoft YaHei'';color:#666666;" lang="EN-US">19</span><span style="text-indent:0cm;font-size:14px;font-weight:normal;line-height:1.5;font-family:''Microsoft YaHei'';color:#666666;">区</span><span style="text-indent:0cm;font-size:14px;font-weight:normal;line-height:1.5;font-family:''Microsoft YaHei'';color:#666666;" lang="EN-US">300</span><span style="text-indent:0cm;font-size:14px;font-weight:normal;line-height:1.5;font-family:''Microsoft YaHei'';color:#666666;">余个小区；易监理的工装监理主要在连锁店监理、餐饮监理、会所、办公楼等领域具有领先优势。</span></p>\n<p><span style="text-indent:0cm;font-size:14px;font-weight:normal;line-height:1.5;font-family:''Microsoft YaHei'';color:#666666;"><br />\n</span></p>\n<p></p>\n<hr />\n<br />\n<p></p>', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `yjl_supervisors` (`id`, `cid`, `name`, `introduction`, `reserve_month`, `profession`, `reserve_total`, `project_count`, `last_reserve`, `avatar`, `telephone`, `status`, `addtime`, `case_info`) VALUES
(1, 7, '王剑', '易监理核心技术人员，二级建造师，思科认证弱电工程师，别墅和工装智能化领域的专家，主要在工装和别墅领域提供专业技术指导。', 0, 1, 0, 0, 0, 'f//51bfd49ed0ea8.jpg', '13636418375', 0, 1371526302, ''),
(2, 7, '陈宏兴', '易监理总监监理师，二级建造师，擅长含有建筑结构改造、钢结构项目等大型装饰监理服务项目，精通预算和材料，管理能力出众，擅长不同工种及分包商之间的协调和进度控制，是行业顶尖的全能型监理师。', 0, 1, 0, 0, 0, '4//51c01affe8f53.jpg', '13636418375', 0, 1371544280, ''),
(3, 7, '高李俊', '易监理资深监理师，一级建造师，造价师，对技术和造价极精通，对大型商业空间建筑和装饰监理、对连锁店外立面及内部装修监理均有数十项服务案例，甲方对高工评价均很高，高工为人谦和，沟通及管理能力强，是易监理重大项目的主要执行监理师。', 0, 1, 0, 0, 0, '2//51c01cb442a9a.jpg', '13636418375', 0, 1371544756, ''),
(5, 7, '顾更魁', '顾更魁是易监理执行总监，资深监理师，原上海装饰集团高级项目经理，对预算、材料、装修质量控制、装修进度控制等极精通；顾老师针对大型装饰项目、连锁装饰项目的管理控制有着行业领先的实践和研究，成功的帮助数十家企业在装修上提升品质，减少费用和控制进度。', 0, 1, 0, 0, 0, '3//51c021a335901.png', '13636418375', 0, 1371546019, ''),
(6, 7, '李保国', '易监理别墅监理师，资深监理师，精通水电和木工，八级电工，原北京大型装饰公司专门负责别墅项目的高级项目经理，管理能力强，对别墅相关的的各类施工协调、质量控制、成本控制等均有极强的管理经验。', 0, 2, 0, 0, 0, '7//51c2fb106f230.jpg', '13636418375', 0, 1371732752, ''),
(7, 7, '白立国', '易监理资深监理师，二级建造师，易监理最抢手的别墅监理师之一，原苏州知名装企工程部经理，从事别墅装饰施工管理十余年，精通设计图纸和预决算，对别墅结构改造、土建施工方面也有着极深造诣，是全能型别墅装修监理。', 0, 2, 0, 0, 0, '6//51c312f46181e.jpg', '13636418375', 0, 1371738868, ''),
(8, 7, '王文清', '资深监理师，原台湾知名装饰企业工程部经理，精通木工工艺，对复杂程度较高的别墅装饰项目有着较强掌控力，在别墅水电施工、安装工程等领域，均是按照台湾香港大型设计型企业的管理模式进行管理，所以做出来的装修实际效果和效果图表现的极其接近，质量也十分精良，适合设计程度很高的装饰项目的管理和监理。', 0, 2, 0, 0, 0, 'c//51c314ae3fd88.jpg', '13636418375', 0, 1371739310, ''),
(9, 7, '戴英男', '易监理金牌监理师，上海人，对装饰质量的提升有着极强掌控力，戴老师知名度较高，因为专业，非常抢手，经常遇到业主推迟装修时间来等戴老师档期，目前主要服务市区大平层和近郊的别墅装修监理。', 0, 2, 0, 0, 0, 'c//51c315d67d217.jpg', '13636418375', 0, 1371739606, ''),
(10, 7, '刘伟', '易监理资深监理师，从事家装行业近20年，启东人，几乎所有工种都非常精通，做过木工，水电工，做过几家大型装饰企业王牌施工队长，因手上工伤改行监理师，为人正直，对公寓业主来说，刘伟是贴心的监理师，简单，高效，能保证装修的品质。', 0, 3, 0, 0, 0, '0//51c317ffb9b0e.jpg', '13636418375', 0, 1371740159, ''),
(11, 7, '胡海', '易监理资深监理师，从事监理行业5年，原百安居工程部项目经理，施工员资质，为人正直，擅长公寓房的施工质量控制，材料审核和进度管理，尤其擅长培训和提升施工队施工技术，是全能型的家装监理师。', 0, 3, 0, 0, 0, '4//51c319a806972.jpg', '13636418375', 0, 1371740584, ''),
(12, 7, '顾更魁', '易监理总监，易监理非常抢手的金牌监理师，因负责工装监理事宜，别墅监理业务每月只新接一单，欢迎提前预约该监理师。', 0, 2, 0, 0, 0, '0//51c31a62af48e.png', '13636418375', 0, 1371740770, ''),
(13, 7, '施井德', '易监理最抢手的金牌监理师之一，技术全面，精通水电、木工、空调、土建结构改造等，对别墅以掌控能力强著称，主要负责大虹桥区域的别墅装饰监理，能切实的帮助业主提升装修质量和有效节约成本。', 0, 2, 0, 0, 0, '3//51c3c5d1b93d8.png', '13636418375', 0, 1371741103, ''),
(14, 7, '施井德', '易监理金牌监理师，负责大虹桥区域的易监理监理项目，从事家装监理近10年，从事装饰行业20多年，技术全面，服务周到，能切实的提升业主的装修质量和帮助业主降低装修成本。', 0, 3, 0, 0, 0, '4//51c3c5b9bdd8f.png', '13636418375', 0, 1371741339, ''),
(15, 7, '师卫华', '资深验房师，原南京著名验房公司核心技术人员，中国最早从事验房服务的一批人，对毛坯及精装修房均有极深的验房经验，能帮助业主和开发商进行有理有据的沟通，切实的保障业主的利益。', 0, 5, 0, 0, 0, '9//51c31d9e55331.jpg', '13636418375', 0, 1371741598, ''),
(16, 7, '施井德', '资深验房师，上海最专业的验房师之一，目前负责易监理大虹桥区域及近郊的验房工作，作为验房组负责人，带领着6位验房师工作，可以提供一天40户左右的团验服务，欢迎报名。', 0, 5, 0, 0, 0, 'e//51c3c57e41dec.png', '13636418375', 0, 1371741833, ''),
(17, 7, '杨哲', '资深预算师，从事预算工作20余年，精通工装定额预算及家装预算，精通材料质量鉴定及价格核算，能高效的帮助业主审核预算问题并提供专业解决方案。', 0, 4, 0, 0, 0, '4//51c31f79cbe34.jpg', '13636418375', 0, 1371742073, ''),
(18, 7, '徐方勇', '徐律师专注于房地产业的相关案件，特别是在房屋质量纠纷，房屋装修质量纠纷上具有丰富的经验，能有效的帮助业主维护和保障自己的权益。', 0, 6, 0, 0, 0, '9//51c320af41893.jpg', '13636418375', 0, 1371742383, ''),
(19, 7, '饶章龙', '注册造价师（顶级），注册一级建造师，科班出身的青年才俊，精通公装定额预算和别墅豪宅内预算，材料管理专家，精通结构工程的改造和施工，是预决算实战型的高级服务人员。', 0, 4, 0, 0, 0, '9//51c322de57828.jpg', '13636418375', 0, 1371742942, ''),
(20, 7, '徐旭云', '易监理资深监理师，建筑装饰行业科班出生，二级建造师，原大型装饰集团别墅事业部工程部经理，专业从事别墅装饰的管理工作，近年来加盟易监理，主要负责上海南区的优质别墅的装修监理服务，因专业程度高，深受业主欢迎，是易监理金牌监理师之一。', 0, 2, 0, 2, 0, 'c//51c3c4a1ac7d5.jpg', '13636418375', 0, 1371784353, '&lt;img src=&quot;data/uploads/2//51c40a9351246.png&quot; alt=&quot;&quot; border=&quot;0&quot; /&gt;&lt;br /&gt;');
